import { useState } from "react";

function App(){
    const[name,setName]=useState("")
    const[email,setEmail]=useState("")
    const[pswd,setPswd]=useState("")
    const[cpswd,setCpswd]=useState("")

const names=(e)=>{
    setName(e.target.value)
}
const emails=(e)=>{
    setEmail(e.target.value)
}
const pswds=(e)=>{
    setPswd(e.target.value)
}
const cpswds=(e)=>{
    setCpswd(e.target.value)
}
const submit=()=>{

    if(pswd!=cpswd){
        alert("password not match...")
    }
    else{
        alert("sucess...")
    }
}




    return(
        <div>
            <form onSubmit={submit}>
                <input name={name} type="text" placeholder="name" required onChange={names}/><br/><br/>
                <input email={email} type="email" placeholder="email" required onChange={emails}/><br/><br/>
                <input pswd={pswd} type="password" placeholder="pswd" required onChange={pswds}/><br/><br/>
                <input cpswd={cpswd} type="password" placeholder="cpswd" requiredonChange={cpswds}/><br/><br/>
                <input type="submit"/>
            </form>
        </div>
    )
}
export default App;
